import React from 'react'
import { BrowserRouter, withRouter } from 'react-router-dom'
import Body from './Body'
const Layout = () => {
    return(
        <BrowserRouter>
            <Body/>
        </BrowserRouter>
    )
}
export default withRouter(Layout)
